function setErrorNotNull(ClassInput, ClassSymbol) {
  const newClassInput = document.body.querySelector(`.${ClassInput}`);
  const newClassSymbol = document.querySelector(`.${ClassSymbol}`);

  return (newClassInput.setAttribute('class', `${ClassInput} -notNull`), newClassSymbol.setAttribute('class', ClassSymbol));
}

export default setErrorNotNull;
